bundler.module('scripts/julia4d.js','// # 4d julia-mandelbrot set\x0a// Just playing around :)\x0avar running;\x0aexports.app = {\x0a    underbar: true,\x0a    type: \x27canvas\x27,\x0a    start: function() {\x0a        running = true;\x0a        julia4d(this.elem);\x0a\x0a    },\x0a    stop: function() {\x0a        running = false;\x0a    }\x0a};\x0a\x0a// First we project into 3d by taking a line(segment) mandelbrotplane as the z-axis, and for each point on the line, find the corresponding julia-pointcloud in the xy-plane.\x0afunction julia4d(canvas) {\x0a    var pts = [];\x0a    // ## Projection from 4d to 3d\x0a    (function() {\x0a        var k;\x0a\x0a        // utility function\x0a        function sign(x) { return x > 0 ? 1 : -1; }\x0a\x0a        // w0-w1 is the line segment in the mandelbrot plane along which we are tracing the julia sets.\x0a        var w0, wi0, w1, wi1;\x0a        // randomise position of line segment\x0a        w0 = wi0 = w1 = wi1 = 0;\x0a        newpts();\x0a        function newpts() {\x0a            w0 += Math.random()-0.5;\x0a            wi0 += Math.random()-0.5;\x0a            w1 += Math.random()-0.5;\x0a            wi1 +=  Math.random()-0.5;\x0a            k = 0;\x0a            // dispatch to do the actual projection\x0a            setTimeout(drawpts,0);\x0a        }\x0a\x0a        // trace along the line segment and generate the 3d point cloud\x0a        function drawpts() {\x0a            // number of discrete samplings along the line in the mandelbrot plane\x0a            var kcount = 30000;\x0a            for(;;){\x0a                if(!running) {\x0a                    return;\x0a                }\x0a                var Newz, Newzi;\x0a                var random = Math.random;\x0a                var sqrt = Math.sqrt;\x0a                var w = k/kcount*w0 + (1-k/kcount) * w1;\x0a                var wi = k/kcount*wi0 + (1-k/kcount) * wi1;\x0a                var z = random() * 2 - 1;\x0a                var zi = random() * 2 - 1;\x0a                for(var j=0;j<20;++j) {\x0a                    var Cx = w;\x0a                    var Cy = wi;\x0a                    z=z-Cx;\x0a                    zi=zi-Cy;\x0a                    if (z>0) {\x0a                         Newz=sqrt((z+sqrt(z*z+zi*zi))/2);\x0a                         Newzi=zi/(2*Newz);\x0a                    } else /* ZX <= 0 */ {\x0a                        if(z<0) {\x0a                            Newzi=sign(zi)*sqrt((-z+sqrt(z*z+zi*zi))/2);\x0a                            Newz=zi/(2*Newzi);\x0a                        } else /* z=0 */ {\x0a                            Newz=sqrt(Math.abs(zi)/2);\x0a                            if (Newz>0) {\x0a                                Newzi=zi/(2*Newz);\x0a                            } else {\x0a                                Newzi=0;\x0a                            }\x0a                        }\x0a                    }\x0a                    if (random()<0.5) {\x0a                        z=Newz;\x0a                        zi=Newzi;\x0a                    } else {\x0a                        z=-Newz;\x0a                        zi=-Newzi;\x0a                    }\x0a                    pts[k] = ({x:z/8, y:zi/8, z:k/kcount/2-0.25});\x0a                }\x0a                ++k;\x0a\x0a                if(k%300===0) {\x0a                    if(k < kcount) {\x0a                        setTimeout(drawpts, 0);\x0a                    } else {\x0a                        setTimeout(newpts,0);\x0a                    }\x0a                    return;\x0a                }\x0a            }\x0a        }\x0a    })();\x0a\x0a\x0a    // ## Project the 3d point cloud onto the screen\x0a    (function() {\x0a        var ctx = canvas.getContext(\x272d\x27);\x0a        var width = canvas.width = 512;\x0a        var height = canvas.height = 512;\x0a        var image = ctx.getImageData(0,0,width,height);\x0a        var pixels = image.data;\x0a        var baseAngle = 0;\x0a        function transform(pt) {\x0a            var a1 = 0.005*baseAngle;\x0a            var a2 = 0.01*baseAngle;\x0a            var x = pt.x * Math.cos(a1) - pt.y * Math.sin(a1);\x0a            var y = pt.x * Math.sin(a1) + pt.y * Math.cos(a1);\x0a            var z = x * Math.sin(a2) + pt.z * Math.cos(a2);\x0a            x = x * Math.cos(a2) - pt.z * Math.sin(a2);\x0a            return {x:x, y:y, z:z};\x0a        }\x0a        function increasePixel(x,y) {\x0a            if(0<x && x<width) {\x0a                pixels[((y|0)*width+(x|0))*4+0] += 50;\x0a            }\x0a        }\x0a        function clear() {\x0a            for(var i=0;i<pixels.length;i+=4) {\x0a                pixels[i]=0;\x0a                pixels[i+3]=255;\x0a            }\x0a        }\x0a        function drawToScreen() {\x0a                if(!running) {\x0a                    return;\x0a                }\x0a                clear();\x0a                for(var i=0;i<pts.length;++i) {\x0a                    var p = pts[i];\x0a                    p = transform(p);\x0a                    increasePixel((p.x+0.5)*width, (p.y+0.5)*height);\x0a                }\x0a                ++baseAngle;\x0a                ctx.putImageData(image,0,0);\x0a                setTimeout(drawToScreen, 20);\x0a        }\x0a        drawToScreen();\x0a    })();\x0a}\x0a');
